				:: Information ::

Riding a motorcycle at speeds approaching 200 miles per hour around hairpin turns 
on hot asphalt is about as intense as motorsports get. MotoGP 3, the latest motorcycle 
racing sim from THQ, captures the spirit of the sport perfectly, with a full roster of 
riders and courses from around the world. This isn't a mere roster update, though. In 
the third installment in the series, developer Climax offers a more arcade-style racing 
experience with the addition of extreme mode, which adds all-new fictional tracks and 
riders to complement the licensed portion of the game. The biggest new feature in 
MotoGP 3 is extreme mode, which lets you race in three different classes on 16 fictional
street courses. You can race 600cc 2-strokes, as well as 1000cc and 1200cc 4-strokes, 
for a total of 16 new bikes


